import React, { Fragment } from "react";
import "./Header.css";
const Header = () => {
  return (
    <Fragment>
      <header>
        <h1>ReactMeals</h1>
        <button>Cart</button>
      </header>
      <div>
        <img
          src="https://github.com/academind/react-complete-guide-code/blob/11-practice-food-order-app/extra-files/meals.jpg?raw=true"
          alt="header-pic"
        />
      </div>
    </Fragment>
  );
};
export default Header;
